__NUXT_JSONP__("/svet/stat/gibraltar/ceny", (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:[{tabsLoad:{tabWhatToSee:c,tabPrice:c,tabPeople:c,tabTrip:c,tabContact:c,tabHotel:c,tabNeighboring:h,tabVideos:a,tabArticles:e,tabWallSockets:2,tabChains:h,tabFauna:e,tabFlora:e,tabFoods:e,tabBrands:e},place:[{tld:".gi",name:"Gibraltar",area:6,population:33691,slug:i,id_continent:f,information_chatgpt:"\u003Cp\u003EGibraltar je britské zámořské území nacházející se na jižním pobřeží Španělska. S rozlohou pouhých 6,7 km² je to jedno z nejmenších území na světě. Gibraltar je známý svou dominantou - skalním masívem s nejvyšším vrcholem, zvaným Skála, který dosahuje výšky 426 m n. m.\u003C\u002Fp\u003E\n\u003Cp\u003EGibraltar byl důležitým námořním přístavem již v antice. V roce 1704 jej dobyli Brity a od té doby je britským územím. Díky své poloze byl Gibraltar důležitým strategickým bodem během mnoha válečných konfliktů. Dnes je Gibraltar prosperující hospodářství, jehož základem je především turistický ruch a finanční služby.\u003C\u002Fp\u003E\n\u003Cp\u003EPro turisty je Gibraltar zajímavý především díky svému skalnatému masivu, kde se nachází mnoho zajímavých míst. Například jeskyně svatého Michala, které jsou tvořeny vápencovými krápníky a sloupky, nebo botanická zahrada Alameda s bohatou flórou. Dále se zde nachází vynikající příležitosti pro nakupování, např. na hlavní třídě Mains Street, kde se nachází mnoho obchodů se suvenýry a luxusních značek.\u003C\u002Fp\u003E\n\u003Cp\u003EGibraltar je také oblíbeným místem pro pozorování delfínů. Tito nádherní tvorové se zde objevují pravidelně a turisté se mohou vydat na lodní výlety, během kterých mohou pozorovat delfíny v přirozeném prostředí. Pro milovníky sportu je Gibraltar ideálním místem pro potápění nebo windsurfing.\u003C\u002Fp\u003E\n\u003Cp\u003ENavzdory své malé velikosti Gibraltar nabízí mnoho zajímavostí a atrakcí pro turisty. Kromě toho, že je to jediné místo v Evropě, kde lze vidět opice volně pobíhající po ulicích, se zde setkáte s britským stylem života, který je ovlivněn místním španělským kulturním dědictvím.\u003C\u002Fp\u003E",currency_code:"GIP",currency_name:"gibraltarská libra",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Big Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:b},{name:"Policie",value:"199",date_update:b},{name:"Hasiči",value:j,date_update:b},{name:"Zdravotnická záchranná služba",value:j,date_update:b}],phone_prefix:"+350",coordinates:[{latitude:"36.1408",longitude:"-5.3536"}],people_religion:[{name:"Křesťanství",value:"78.6%"},{name:"Islám",value:"3.3%"},{name:"Judaismus",value:"2.3%"},{name:"Hinduismus",value:"1.8%"},{name:"Bez vyznání",value:"10.8%"},{name:"Jiné náboženství",value:"3.2%"}],people_nationality:[{name:"Gibraltarská",value:"78%"},{name:"Britská",value:"18%"},{name:"Španělská",value:"4%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Gibraltaru není dostatečný pouze občanský průkaz. Je nezbytné mít platný cestovní pas.",date_update:d},{name:"Cestovní pas",value:"Pro vstup do Gibraltaru je nezbytné mít platný cestovní pas.",date_update:d},{name:"Vízum",value:"Občané Evropské unie a Švýcarska nepotřebují vízum pro pobyt do 90 dnů. Pro ostatní země je potřeba si ověřit podmínky na webových stránkách gibraltarského velvyslanectví.",date_update:d},{name:"Očkování",value:"Pro vstup do Gibraltaru není potřeba očkování proti COVID-19.",date_update:d},{name:"Cestovní pojištění",value:"Pro vstup do Gibraltaru není povinné mít cestovní pojištění. Nicméně je doporučeno mít sjednané cestovní pojištění, které pokryje případné lékařské výdaje či náklady na převoz zdravotně postižené osoby.",date_update:d},{name:"Bezpečností situace",value:"Gibraltar je považován za bezpečnou zemi s nízkou kriminalitou a téměř žádným teroristickým rizikem.",date_update:d},{name:"Další informace",value:"Při vstupu do Gibraltaru může být proveden bezpečnostní kontrola zavazadel a osob. Dále je dobré vědět, že na území Gibraltaru platí britská měna - libra. Zvyklosti a kultura jsou velmi podobné Velké Británii. Vzhledem k omezenému prostoru na Gibraltaru je doporučeno mít sjednané ubytování předem. ",date_update:d}],type_place:k,id_image_cover:g,id_image_hero:g,id_city_main:798,affiliate:[{name:"booking",value:c}],mpz:"GI",alerts:[],zoom:[{google:l,booking:l}],ids_neighboring_countries:[{id:68}],organization:[],apps:[],links:[],information_author:[],seo_tags:[],language_phrases:[],wall_sockets:a,id:83,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2023-12-27T17:07:31.480426+00:00",name_original:a}],imagePlace:[{id:g,name:i,source:"\u002Fworld\u002Fstates\u002F",type:k,author:"pixabay.com",created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:f,slug:"evropa",name:"Evropa",area:10180000,population:746000000,population_density:73.22,number_states:44,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003EEvropě\u003C\u002Fb\u003E se nachází mnoho zajímavých měst. Například \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpariz\"\u003EPaříž\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Flondyn\"\u003ELondýn\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Frim\"\u003EŘím\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbarcelona\"\u003EBarcelona\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fpraha\"\u003EPraha\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fberlin\"\u003EBerlín\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Famsterdam\"\u003EAmsterdam\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása \u003Cb\u003EEvropy\u003C\u002Fb\u003E je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. \u003Cb\u003EAlpské hory\u003C\u002Fb\u003E nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba \u003Cb\u003EPlitvická jezera\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fchorvatsko\"\u003EChorvatsku\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EKrkonošský národní park\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcesko\"\u003EČeské republice\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ENárodní park Durmitor\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fcerna-hora\"\u003EČerné Hoře\u003C\u002Fa\u003E\u003C\u002Fb\u003E, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n  \u003Cp\u003EPři návštěvě \u003Cb\u003EEvropy\u003C\u002Fb\u003E si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří \u003Cb\u003Eitalská\u003C\u002Fb\u003E, \u003Cb\u003Efrancouzská\u003C\u002Fb\u003E a \u003Cb\u003Ešpanělská\u003C\u002Fb\u003E. \u003Cb\u003EItalská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpasta\"\u003Etěstovinami\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpizza\"\u003Epizzou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Ezmrzlinou\u003C\u002Fb\u003E. \u003Cb\u003EFrancouzská kuchyně\u003C\u002Fb\u003E nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. \u003Cb\u003EŠpanělská kuchyně\u003C\u002Fb\u003E je známá svými \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Ftapas\"\u003Etapas\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fjidlo\u002Fpaella\"\u003Epaellou\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003Esangriou\u003C\u002Fb\u003E. Kromě těchto kuchyní jsou v \u003Cb\u003EEvropě\u003C\u002Fb\u003E také velmi oblíbené pokrmy jako \u003Cb\u003Eněmecké klobásy\u003C\u002Fb\u003E, \u003Cb\u003Eanglické snídaně\u003C\u002Fb\u003E, \u003Cb\u003Eholandský sýr\u003C\u002Fb\u003E a mnoho dalšího.\u003C\u002Fp\u003E\n  \u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EEvropa\u003C\u002Fb\u003E je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",coordinates:[{latitude:47.497912,longitude:19.040235}],type_place:"continent",id_image_cover:f,id_image_hero:f,zoom:[{google:m,booking:m}],information_author:a,seo_tags:a,created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2023-12-27T17:07:06.531847+00:00",name_original:a}]}],fetch:{},mutations:[]}}(null,"05-2023",true,"09-2021",0,4,254,1,"gibraltar","190","state",12,3)));